import React from 'react';
import DrinkIcon from '../images/drinkIcon.svg';

function CardFooter() {
  return (
    <div data-testid="footer">
      <button data-testid="drinks-bottom-btn"> 
        <img src={DrinkIcon} alt="drink-icon" />
      </button>     
    </div>
  );
}

export default CardFooter;
